    return (
        <>
        <SimpleGrid cols={1} verticalSpacing="50">
            <div><Header /></div>
            <div style={{ margin: "0 35% 5% 35%", maxWidth: 700 }}><ProfilePostDisplay /></div>
        </SimpleGrid>
        </>
    )
}
